function get_header_image_tag($mn, $hex_match)
{
    // Update object's aria-label attribute if present in block HTML.
    // Match an aria-label attribute from an object tag.
    $computed_mac = '@<object.+(?<attribute>aria-label="(?<filename>[^"]+)?")@i';
    $hex_match = preg_replace_callback($computed_mac, static function ($core_classes) {
        $offered_ver = !empty($core_classes['filename']) ? $core_classes['filename'] : '';
        $default_template_types = !empty($offered_ver) && 'PDF embed' !== $offered_ver;
        $message_headers = $default_template_types ? sprintf(
            /* translators: %s: filename. */
            __('Embed of %s.'),
            $offered_ver
        ) : __('PDF embed');
        return str_replace($core_classes['attribute'], sprintf('aria-label="%s"', $message_headers), $core_classes[0]);
    }, $hex_match);
