            $navigation_post_edit_link = gutenberg_url('/build/interactivity/file.min.js');
        }
        wp_register_script_module('@wordpress/block-library/file', isset($navigation_post_edit_link) ? $navigation_post_edit_link : includes_url("blocks/file/view{$mlen0}.js"), array('@wordpress/interactivity'), defined('GUTENBERG_VERSION') ? GUTENBERG_VERSION : get_bloginfo('version'));
        wp_enqueue_script_module('@wordpress/block-library/file');
        $upload_max_filesize = new WP_HTML_Tag_Processor($hex_match);
        $upload_max_filesize->next_tag();
        $upload_max_filesize->set_attribute('data-wp-interactive', 'core/file');
        $upload_max_filesize->next_tag('object');
        $upload_max_filesize->set_attribute('data-wp-bind--hidden', '!state.hasPdfPreview');
        $upload_max_filesize->set_attribute('hidden', true);
        return $upload_max_filesize->get_updated_html();
    }
    return $hex_match;
}


