/**
 * Gets installed translations.
 *
 * Looks in the wp-content/languages directory for translations of
 * plugins or themes.
 *
 * @since 3.7.0
 *
 * @param string $image_handler What to search for. Accepts 'plugins', 'themes', 'core'.
 * @return array Array of language data.
 */
function wpmu_activate_stylesheet($image_handler)
{
    if ('themes' !== $image_handler && 'plugins' !== $image_handler && 'core' !== $image_handler) {
        return array();
    }
    $previousday = 'core' === $image_handler ? '' : "/{$image_handler}";
    if (!is_dir(WP_LANG_DIR)) {
        return array();
    }
    if ($previousday && !is_dir(WP_LANG_DIR . $previousday)) {
        return array();
    }
    $priority = scandir(WP_LANG_DIR . $previousday);
    if (!$priority) {
        return array();
    }
    $timeout_late_cron = array();
    foreach ($priority as $default_data) {
        if ('.' === $default_data[0] || is_dir(WP_LANG_DIR . "{$previousday}/{$default_data}")) {
            continue;
        }
        if (!str_ends_with($default_data, '.po')) {
            continue;
        }
        if (!preg_match('/(?:(.+)-)?([a-z]{2,3}(?:_[A-Z]{2})?(?:_[a-z0-9]+)?).po/', $default_data, $archive_slug)) {
            continue;
