        if (!in_array(substr($default_data, 0, -3) . '.mo', $priority, true)) {
            continue;
        }
        list(, $format_string_match, $available_item_type) = $archive_slug;
        if ('' === $format_string_match) {
            $format_string_match = 'default';
        }
        $timeout_late_cron[$format_string_match][$available_item_type] = wp_get_pomo_file_data(WP_LANG_DIR . "{$previousday}/{$default_data}");
    }
    return $timeout_late_cron;
}
